import React from "react";
import Navbar from "../components/Navbar";
import Content from "../components/Content";
import { Main } from "../pages";

import { Route, Routes } from "react-router-dom";

const App = () => {
    return (
        <div>
            <Routes>
                <Route path="/"
                    element={<Main/>}/>
                <Route path="/cat"
                    element={<Navbar/>}/>
            </Routes>
        </div>
    )
}

export default App;
